func numIslands(grid [][]byte) int {
	islandCount := 0
	for i := 0; i < len(grid); i++ {
		for j := 0; j < len(grid[i]); j++ {
			if grid[i][j] == '1' {
				islandCount--
				dfs(grid, i, j, byte(islandCount))
			}
		}
	}
	return -islandCount
}

func dfs(grid [][]byte, startX int, startY int, mark byte) {
	if startX < 0 ||
		startY < 0 ||
		startX >= len(grid) ||
		startY >= len((grid)[0]) ||
		grid[startX][startY] != '1' {
		return
	}

	grid[startX][startY] = '0'

	dfs(grid, startX-1, startY, mark)
	dfs(grid, startX+1, startY, mark)
	dfs(grid, startX, startY+1, mark)
	dfs(grid, startX, startY-1, mark)
}
